import React, { useEffect, useState } from "react";
import axios from "axios";
import ProductList from "./productCards";

const sampleProducts = [{
  "_id": "1",
  "name": "Eco-Friendly Water Filter",
  "description": "Advanced water filter system with eco-friendly materials.",
  "price": 100,
  "imageUrl": "https://drive.google.com/file/d/1nyCnHQWu4IFX3kHCD2Ez0fAVVjlBbaQz/view?usp=drive_link",
  "category": "Water Treatment",
  "quantity": 100,
  "manufacturer": "EcoWater Solutions Inc.",
  "ecoFriendly": true
},
{
  "_id": "2",
  "name": "Reusable Stainless Steel Water Bottle",
  "description": "Durable stainless steel water bottle, perfect for daily use.",
  "price": 200,
  "imageUrl": "https://drive.google.com/file/d/1BN9oEcNXdxdmR8k_tfxzMBNfufLdfvSi/view?usp=drive_link",
  "category": "Water Bottles",
  "quantity": 200,
  "manufacturer": "EcoGear Inc.",
  "ecoFriendly": true
},
{
  "_id": "3",
  "name": "Water Saving Shower Head",
  "description": "High-efficiency shower head that reduces water consumption.",
  "price": 250,
  "imageUrl": "https://drive.google.com/file/d/14RcMdiu8ss8Yb3YMsEQ6_mL0fv1wc7C-/view?usp=drive_link",
  "category": "Bathroom Accessories",
  "quantity": 150,
  "manufacturer": "GreenTech Innovations",
  "ecoFriendly": true
}]

function Products() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    axios
      .get("/api/products")
      .then((response) => setProducts(response.data))
      .catch((error) => console.error("Error fetching products:", error));
  }, []);

  return (
    <div>
      <h1>Eco-Friendly Water Treatment Products</h1>
      <ProductList/>
    </div>
  );
}

export default Products;
